import React from 'react'
import Navigation from '../components/Navigation'
import Container from 'react-bootstrap/Container'
import styled from 'styled-components'


const Jumbo = styled.div `
    width:100%;
    height: 70vh;
    background: hsla(167, 97%, 63%, 1);
    background: linear-gradient(90deg, hsla(167, 97%, 63%, 1) 0%, hsla(210, 37%, 93%, 1) 60%);
    background: -moz-linear-gradient(90deg, hsla(167, 97%, 63%, 1) 0%, hsla(210, 37%, 93%, 1) 60%);
    background: -webkit-linear-gradient(90deg, hsla(167, 97%, 63%, 1) 0%, hsla(210, 37%, 93%, 1) 60%);
    filter: progid: DXImageTransform.Microsoft.gradient( startColorstr="#47FCD5", endColorstr="#E5ECF3", GradientType=1 );
`;
const Section = styled.div `
   border-radius:50px;
`;

function Landing() {
    return (
    <React.Fragment>
        <Navigation />

        <Jumbo>
            <Container fluid='md'>
                <h1 className='display-4'> Buy. Sell. Mix.</h1>
            </Container>
        </Jumbo>

        <Section>
            <h1> Section Content</h1>
        </Section>

    </React.Fragment>


    )
}

export default Landing
